import * as React from 'react';
import type { ColoredIconProps } from '../types';
import { DEFAULT_SIZE } from '../types';
import { uniquifySvgIds } from '../uniqueSvgIds';

const useIsoLayoutEffect =
  typeof window !== 'undefined' ? React.useLayoutEffect : React.useEffect;

export const NaverBandLogo = ({
  size = DEFAULT_SIZE,
  title,
  ...props
}: ColoredIconProps) => {
  const ref = React.useRef<SVGSVGElement | null>(null);

  useIsoLayoutEffect(() => {
    if (ref.current) {
      uniquifySvgIds(ref.current);
    }
  }, []);

  return (
    <svg
      ref={ref}
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 22 22"
      width={size}
      height={size}
      fill="none"
      aria-hidden={title ? undefined : true}
      aria-label={title}
      role={title ? 'img' : undefined}
      {...props}
    >
      {title && <title>{title}</title>}
      <rect width="22" height="22" fill="url(#pattern0_2332_6909)" />
      <defs>
        <pattern
          id="pattern0_2332_6909"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use xlinkHref="#image0_2332_6909" transform="scale(0.00195312)" />
        </pattern>
        <image
          id="image0_2332_6909"
          width="512"
          height="512"
          preserveAspectRatio="none"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
};

NaverBandLogo.displayName = 'NaverBandLogo';
